        const createDigits = () => {
          const Digits = [];

          for (let i = 1; i < 10; i++)
          {
            Digits.push 
            (
              <button> key={i}>{i} </button>
            )
          }
          return Digits;
        }


  return (
    <div className="App">
      <div className="Calculator">

        <div className="Display">
          <span>(0)</span> 0
        </div>

        <div className="Operators">
              <button>/</button>
              <button>*</button>
              <button>+</button>
              <button>-</button>

              <button>DEL</button>
        </div>

        <div className="Digits">
              {createDigits () }
              <button>0</button>
              <button>.</button>
              <button>=</button>
        </div>

      </div>
    </div>
  );
}

export default App;
